IT seems lip enhancements have massively developed over the last few years, with many going for a lip flip as opposed to traditional filler.&nbsp;
A lip flip is a nonsurgical procedure that makes your lips appear fuller using Botox to relax a muscle in the upper lip causing the lip to ‘flip'.
The procedure is usually considered more natural looking than lip fillers but it can take a bit of time for your lips to fully develop.

